import React, { Component } from "react";

class Navbar extends Component {
  state = {};
  render() {
    return (
        <nav className="navbar fixed-bottom navbar-light bg-light">
        <a className="navbar-brand" href="#">Fixed bottom</a>
      </nav>
    );
  }
}

export default Navbar;
